import React from 'react';
import Grid from "@material-ui/core/Grid";
import {makeStyles, Paper, TextField} from "@material-ui/core";
import Button from "@material-ui/core/Button";
import { confirmAlert } from 'react-confirm-alert'; // Import
import './react-confirm-alert.css';
import { useHistory } from "react-router-dom";
import {SessionManager} from "../Others/SessionManager";
import axios from "axios";


const useStyles = makeStyles((theme) => ({
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: 200,
        },
    },

    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        height: '80vh', width: '100vh',
    },
}));

// const options = {
//     title: 'Title',
//     message: 'Message',
//     buttons: [
//         {
//             label: 'Yes',
//             onClick: () => alert('Click Yes')
//         },
//         {
//             label: 'No',
//             onClick: () => alert('Click No')
//         }
//     ],
//     childrenElement: () => <div />,
//     customUI: ({ onClose }) => <div>Custom UI</div>,
//     closeOnEscape: true,
//     closeOnClickOutside: true,
//     willUnmount: () => {},
//     afterClose: () => {},
//     onClickOutside: () => {},
//     onKeypressEscape: () => {},
//     overlayClassName: "overlay-custom-class-name"
// };

const BecomeSeller = () => {
    const history = useHistory();

    const submitData = () => {
        const id= SessionManager.getUserId()
        axios.put(`http://localhost:2000/users/${id}`, {
                    headers: {Authorization: 'Bearer ' + SessionManager.getAccessToken()}
                })
                    .then((response) => {
                        console.log(response)
                    })
                    .catch((error) => {
                        console.log(error)
                    })

        confirmAlert({

            message: 'Your request is on process, We will get back to you soon.',
            buttons: [
                {
                    label: 'Ok',
                    onClick: () => {
                        let path = "/";
                        history.push(path);
                    }

                },
            ]
        });
    };
    const classes = useStyles();
    return (
        <Grid container xs={12}>
            <Paper className={classes.paper}>
                <Grid container xs={12} align={'center'}>
                    <Grid xs={6}>
                        <TextField label="Phone Number" id="standard-size-small" size="small"/>


                    </Grid>
                    <Grid xs={6}>
                        <TextField label="Alternative Phone Number" id="standard-size-small" size="small"/>

                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Current Location" id="standard-size-small" size="small"/>
                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Permanent Location" id="standard-size-small" size="small"/>

                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Password" id="standard-size-small" size="small"/>
                    </Grid>
                    {/*<Grid xs={12}>*/}
                    {/*    <TextField label=" Confirm Password" id="standard-size-small" size="small"/>*/}
                    {/*</Grid>*/}
                    <Grid xs={12}>
                        <Button onClick={submitData}> Submit </Button>
                    </Grid>
                </Grid>


            </Paper>

            <Grid container xs={6}>
            </Grid>


        </Grid>

    )
        ;
};

export default BecomeSeller;
